import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const Home = () => {
    return (
        <View style={styles.container}>
            <View style={styles.home_Box}>
                <View style={styles.head_Flex}>
                    <Text style={styles.textStyle}>Services</Text>
                    <Text style={styles.textStyle_Btn}>Show All</Text>
                </View>
                
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    container: {
        width: '100vw',
        height: '60vh',
        backgroundColor: "#fff",
    },
    home_Box: {
        width: '100vw',
        height: '100vh',
        backgroundColor: "#fff",
        borderTopRightRadius: '5%',
        margin: 'auto',
    },
    head_Flex: {
        flex: 1,
        flexDirection: 'row',
        justifyContent: 'space-between',
        padding: '20px',
        margin: '20px',
    },
    textStyle: {
        color: "#102C56",
        fontSize: '18px',
        fontWeight: '500',
        lineHeight: '14px',
        letterSpacing: '2%',
    },
    textStyle_Btn: {
        color: "orange",
        fontSize: '16px',
        fontWeight: '500',
        lineHeight: '19px',
        letterSpacing: '2%',
    }
})

export default Home;
